	Tc MulAtoConjB(Tc A, Tc B)
	{
		Tc tmp;
		tmp.real = (A.real * B.real) + (A.imag * B.imag);
		tmp.imag = (A.imag * B.real) - (A.real * B.imag);
		return tmp;
	}
	void MulAtoConjB_inplace(Tc &A, Tc B)
	{
		Ts re = (A.real * B.real) + (A.imag * B.imag);
		A.imag = (A.imag * B.real) - (A.real * B.imag);
		A.real = re;
	}

